import "./style.css";
export default function Login() {
  return (
    <div className="main-form">
      <div className="logo-teams"> 
        <img class="logo" src="https://statics.teams.cdn.office.net/hashedassets-launcher/v2/logo_teams.2806c5625995dc0f79c4747b5de9d43d.svg" />
      </div>
    </div>
  );
}
